// AddProductForm.js
import React, { useState } from 'react';
import './AddProductPage.css';

const AddProductPage = () => {
  const [productName, setProductName] = useState('');
  const [productPrice, setProductPrice] = useState('');

  const handleProductNameChange = (e) => {
    setProductName(e.target.value);
  };

  const handleProductPriceChange = (e) => {
    setProductPrice(e.target.value);
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    // Handle form submission (e.g., send data to backend)
    console.log('Product Name:', productName);
    console.log('Product Price:', productPrice);
    // You can perform any additional actions here, like sending the data to a server
  };

  return (
    <form className="add-product-form" onSubmit={handleSubmit}>
      <h2 className="title">Add Product</h2>
      <label htmlFor="email">Product Name:</label>
      <input
        type="text"
        placeholder="Product Name"
        value={productName}
        onChange={handleProductNameChange}
        required
      />
      <label htmlFor="email">Product Price:</label>
      <input
        type="number"
        placeholder="Product Price"
        value={productPrice}
        onChange={handleProductPriceChange}
        required
      />
      <label htmlFor="email">Product Category:</label>
      <input
        type="text"
        placeholder="Product Category"
        value={productPrice}
        onChange={handleProductPriceChange}
        required
      />
      <label htmlFor="email">Product UserId:</label>
      <input
        type="text"
        placeholder="Product UserId"
        value={productPrice}
        onChange={handleProductPriceChange}
        required
      />
      <label htmlFor="email">Product Company:</label>
      <input
        type="text"
        placeholder="Product Company"
        value={productPrice}
        onChange={handleProductPriceChange}
        required
      />
      <button className="button" type="submit">Add Product</button>
    </form>
  );
};

export default AddProductPage;
